import React, { useEffect, useState } from 'react';
import { CSVLink } from 'react-csv';
import {getStudentVaccinationDetails} from "../services/vaccineReports";

interface ReportEntry {
    id: string;
    name: string;
    classNmae: string;
    vaccineName: string;
    vaccinationDate: string;
}

const Reports: React.FC = () => {
    const [reports, setReports] = useState<ReportEntry[]>([]);
    const [filtered, setFiltered] = useState<ReportEntry[]>([]);
    const [vaccineFilter, setVaccineFilter] = useState<string>('All');
    const [currentPage, setCurrentPage] = useState<number>(1);
    const itemsPerPage = 5;

    useEffect(() => {
        const fetchReports = async () => {
            const data = await getStudentVaccinationDetails(); // Assuming this returns vaccination info too
            setReports(data);
            setFiltered(data);

        };
        fetchReports();
    }, []);

    useEffect(() => {
        if (vaccineFilter === 'All') {
            setFiltered(reports);
        } else {
            setFiltered(reports.filter(r => r.vaccine === vaccineFilter));
        }
        setCurrentPage(1);
    }, [vaccineFilter, reports]);

    const vaccines = Array.from(new Set(reports.map(r => r.vaccine)));

    const paginated = filtered.slice(
        (currentPage - 1) * itemsPerPage,
        currentPage * itemsPerPage
    );

    const totalPages = Math.ceil(filtered.length / itemsPerPage);

    return (
        <div>
            <h2>Vaccination Reports</h2>

            <div className="mb-3">
                <label>Filter by Vaccine:</label>
                <select
                    className="form-select"
                    value={vaccineFilter}
                    onChange={(e) => setVaccineFilter(e.target.value)}
                >
                    <option value="All">All</option>
                    {vaccines.map((vaccine) => (
                        <option key={vaccine} value={vaccine}>
                            {vaccine}
                        </option>
                    ))}
                </select>
            </div>

            <table className="table table-bordered">
                <thead>
                <tr>
                    <th>Name</th>
                    <th>Class</th>
                    <th>Vaccine</th>
                    <th>Date</th>
                    <th>Vaccinated</th>
                </tr>
                </thead>
                <tbody>
                "id": 1,
                "name": "Rajesh",
                "age": 6,
                "className": "Grade 1",
                "vaccinationStatus": "Vaccinated",
                "vaccineName": "Manigococal",
                "driveDate": "2025-05-30",
                "applicableClasses": "grade 0",
                "vaccinationDate": "2024-06-07"
                },
                {paginated.map((entry) => (
                    <tr key={entry.id}>
                        <td>{entry.name}</td>
                        <td>{entry.className}</td>
                        <td>{entry.vaccineName}</td>
                        <td>{new Date(entry.vaccinationDate).toLocaleDateString()}</td>
                        <td>{entry.vaccinated ? 'Yes' : 'No'}</td>
                    </tr>
                ))}
                </tbody>
            </table>

            <div className="d-flex justify-content-between align-items-center">
                <div>
                    Page {currentPage} of {totalPages}
                </div>
                <div>
                    <button
                        className="btn btn-secondary me-2"
                        disabled={currentPage === 1}
                        onClick={() => setCurrentPage((p) => p - 1)}
                    >
                        Previous
                    </button>
                    <button
                        className="btn btn-secondary"
                        disabled={currentPage === totalPages}
                        onClick={() => setCurrentPage((p) => p + 1)}
                    >
                        Next
                    </button>
                </div>
            </div>

            <div className="mt-3">
                <CSVLink
                    data={filtered}
                    filename="vaccination_report.csv"
                    className="btn btn-success"
                >
                    Export CSV
                </CSVLink>
            </div>
        </div>
    );
};

export default Reports;
